    "2016-11-25T21:06:39.212526",nt"name": "trends-in-international-mathematics-and-science-study-2011",nt"isopen":
    true,nt"url": null,nt"notes": "The Trends in International Mathematics
    and Science Study, 2011 (TIMSS 2011), is a study that is part of the Trends in International
    Mathematics and Science Study (TIMSS) program. TIMSS 2011 (http://nces.ed.gov/timss/)
    is a cross-sectional study that provides international comparative information of
    the mathematics and science literacy of fourth- and eighth-grade students and examines
    factors that may be associated with the acquisition of math and science literacy
    in students. The study was conducted using direct assessments of students and questionnaires
    for students, teachers, and school administrators. Fourth- and eighth-graders in
    the 2010-11 school year were sampled. The study's response rate was 94 percent.
    Key statistics produced from TIMSS 2003 are mathematics and science achievement
    scores of U.S. fourth- and eighth- grade students compared to that of students in
    other countries.",nt"license_title": "Creative Commons CCZero",nt"extras":
